/*Table structure for table `rcd_staff` */

DROP TABLE IF EXISTS `rcd_staff`;

CREATE TABLE `rcd_staff` (
  `id` bigint NOT NULL COMMENT '主键',
  `account` bigint DEFAULT NULL COMMENT '账户id',
  `code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '档案码',
  `name` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
  `dept` bigint DEFAULT NULL COMMENT '科室',
  `sex` int DEFAULT NULL COMMENT '性别',
  `empno` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '工号',
  `phone` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `email` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `birthday` bigint DEFAULT NULL COMMENT '出生日期',
  `birthplace` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '出生地',
  `address` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '现住地址',
  `idcard` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证号',
  `marriage` bigint DEFAULT NULL COMMENT '婚姻 dict',
  `nation` bigint DEFAULT NULL COMMENT '民族 dict',
  `native` bigint DEFAULT NULL COMMENT '籍贯 dict',
  `nationality` bigint DEFAULT NULL COMMENT '国籍 dict',
  `political` bigint DEFAULT NULL COMMENT '政治面貌 dict',
  `work_time` bigint DEFAULT NULL COMMENT '工作时间',
  `del` tinyint(1) DEFAULT '0' COMMENT '删除标识',
  `create` bigint DEFAULT NULL COMMENT '创建时间',
  `creator` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `update` bigint DEFAULT NULL COMMENT '更新时间',
  `updater` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

