/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `username` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '登录名',
  `password` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '密码',
  `expired` tinyint(1) DEFAULT '0' COMMENT '是否过期',
  `locked` tinyint(1) DEFAULT '0' COMMENT '是否锁定',
  `enabled` tinyint(1) DEFAULT '1' COMMENT '是否可用',
  `client` bigint DEFAULT NULL COMMENT '客户端名称',
  `role` bigint DEFAULT NULL COMMENT '角色名称',
  `avatar` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '头像',
  `del` tinyint(1) DEFAULT '0' COMMENT '删除标识',
  `create` bigint DEFAULT NULL COMMENT '创建时间',
  `creator` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `update` bigint DEFAULT NULL COMMENT '更新时间',
  `updater` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=13863105553633281 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

