/* Function  structure for function  `add_role` */

/*!50003 DROP FUNCTION IF EXISTS `add_role` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `add_role`(p_id bigint(20),p_code varchar(20),p_name varchar(20),p_intro varchar(200), p_creator varchar(20)) RETURNS int
BEGIN
/*current timestamp*/
declare p_time bigint(20) default 0;
/*cursor index*/
declare cursor_idx bigint(20) default 0;
/*cursor value*/
declare per_id bigint(20);
/*set cursor*/
declare per_cursor cursor for select pp.id from sys_permission as pp where pp.code is not null and pp.code != '';
/*set end value of cursor index*/
declare CONTINUE handler for not found set cursor_idx = 1;
SET p_time = UNIX_TIMESTAMP() * 1000;
/*save role*/
INSERT INTO sys_role(`id`,`code`,`name`,`intro`,`create`,`creator`,`update`,`updater`) 
VALUE (p_id,p_code,p_name,p_intro,p_time,p_creator,p_time,p_creator);
/*open cursor*/
open per_cursor;
cursor_loop: loop
/*get cursor value to param*/
fetch per_cursor into per_id;
/*if end ,end*/
if cursor_idx = 1
then leave cursor_loop;
else
insert into sys_role_permission(role_id,per_id,`create`,`creator`,`del`,`update`,`updater`) 
value (p_id,per_id,p_time,p_creator,true,p_time,p_creator);
end if;
/*end and close cursor*/
end loop cursor_loop;
close per_cursor;
return 1;
END */$$
DELIMITER ;

